text:
 @VictorSilva-qf2tu  Concordo! Mas ver o fluminense abrir mão de competir, só apequena o clube! Se o Palmeiras for melhor que ganhe o jogo por méritos dele, e não com uma ajudinha do adversário!

É normal torcedores cogitar situações de não ganhar etc, mas o clube profissional ter essa postura, é lamentável!

A Graça do futebol é a competitividade, agora adversário decidindo entrar com os piores jogadores já planejando a derrota, so enfraquece o futebol brasileiro!
